import React from 'react';

function App() {
	return (
		<div className="bg-gray-900 min-h-screen flex flex-col justify-center">
			<div className="bg-gray-700 px-10 py-10 mx-auto text-center">
				<h1 className="text-5xl text-white font-extralight">Drop here to upload</h1>
				<h3 className="text-xl text-gray-400 mb-10">Or click here to select a file</h3>
			</div>
		</div>
	);
}

export default App;
